require 'mandrill_event_converter'

describe MandrillEventConverter do
  it 'extracts raw message and converts to mail object' do
    converter = MandrillEventConverter.new(MandrillEvent::PARAMS)
    mail = converter.convert
    mail.subject.should == 'Testing'
    mail.from.should == ['sachin@siyelo.com']
    mail.to.should == ['test@inbound.hound.cc']
  end

end

